import './TodoItem.css';
import {TodoCheck} from '../TodoIcon/TodoCheck';
import { DeleteIcon } from '../TodoIcon/DeleteIcon';

function TodoItem({text,completed,onCompleted, onDelete}) {
    return (
      <li className='TodoItem'>
        <TodoCheck 
        isDone={completed} 
        markTodoAsCompleted={onCompleted} />
        <p>{text}</p>
        <DeleteIcon
          onDelete={onDelete}
          />
      </li>
    );
  }
  export {TodoItem};
